import React, { useEffect } from "react";
import { io } from "socket.io-client";
import "./App.css";

function App() {
  const socket = io("http://localhost:3001", { transports: ["websocket"] });

  return (
    <div>
      <h1>Hello World!</h1>
      <p>Your Socket.IO ID is: {socket.id}</p>
    </div>
  );
}

export default App;
